import React ,{useState} from "react";
import {　BrowserRouter as Router,　Switch,　Route　} from "react-router-dom";
import quizData from "./quiz-data.json"
import QuizList from "./QuizList";
import Home from "./components/Home";
import Congrats from "./components/Congrats";
import Again from "./components/Again";
import './App.scss';

function App() {
  const [quizs] = useState(quizData)

  return (
    <>
      <Router>
        <div>
          <Switch>
            <Route path="/congrats">
              <Congrats />
            </Route>
            <Route path="/again">
              <Again />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>

      <QuizList quizs={quizs} />
    </>
  );
}

export default App;
